import React, { Component } from 'react';
import { Navbar } from 'react-bootstrap';
// import './AccoutHome.css';

class Navigation extends Component {
  render() {
    return (
        <>
            <Navbar bg="primary">
                <img
                    alt=""
                    src="/logo.svg"
                    width="30"
                    height="30"
        className="d-inline-block align-top"
        />
            </Navbar>
        </>
    );
  }
}

export default Navigation;
